import React from 'react';
import './Cards.css';



function InfoCard() {
  return (
    <div className='cardsInfo'>
        <div className='containerInfo'>

            <div className='container-image'>
              <img className='imagen' src='./images/PlanMaestro.png' />
            </div>
        </div>
    </div>
  );
}

export default InfoCard;
